import { Link } from 'react-router-dom';

export default function Home() {
    const mystyle = {
       textAlign: 'center',
       marginTop: '30px'
      };
  return (
    <div style={mystyle}> home page
    
    <Link to='/pages' > Pages</Link>
     </div>
  )
}
